import { StyleSheet, Text, View } from 'react-native'

import React from 'react'
import { createDrawerNavigator } from '@react-navigation/drawer'
import { useNavigation } from '@react-navigation/native'

const IntakeScreen = ({ route }) => {

  const Drawer = createDrawerNavigator()

  return (
    <Drawer.Navigator  screenOptions={{
        // drawerStyle: {
        //     backgroundColor: '#c6cbef',
        //     width: 100,
        //   },

          drawerType: 'permanent',

        headerShown: false,
    }}>

        <Drawer.Screen options={{drawerItemStyle: {
            cursor: ''
        }}} name='IntakeStart' component={MyComponent} />      

        {/* <Text>IntakeScreen</Text>
      <Text>{route.params.userId}</Text> */}
    </Drawer.Navigator>
  )
}

export default IntakeScreen

const styles = StyleSheet.create({})

function MyComponent({ navigation }) {

  return (
    <View>
      <Text onPress={() => navigation.navigate('Login')}>IntakeScreen</Text>
    </View>
  )
}
